  `update_time` int(11) NOT NULL DEFAULT '0' COMMENT '#yhc_name#更新时间#yhc_type#laydate#yhc_show#0',
  `status` int(11) NOT NULL DEFAULT '1',
  `cate1` varchar(255) DEFAULT NULL,
  `cate2` varchar(255) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=5765 DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC;
